# Given a (hex string) ICAO address,
# return an object describing that ICAO range.
# Always returns a non-null object.
##   (todo: binary search)

def find_icao_range(icao):
    

    if icao == '------' :
        return ''
    
    hexa = int(icao, 16)
    
    
    iso = ''
    for icao_range in ICAO_Ranges:
        if hexa >= icao_range['start'] and hexa <= icao_range['end']:
            iso = icao_range['iso']
            # print(icao,hexa,iso)
            return iso

    return ''


